CREATE TABLE repairShop (
    repid CHAR(4) PRIMARY KEY,
    `name` VARCHAR(50),
    address VARCHAR(50),
    zip_code VARCHAR(10),
    state CHAR(2),
    license VARCHAR(50),
    phone VARCHAR(25),
    email VARCHAR(50),
    subscriptionEndsOn DATE
);
CREATE TABLE vendor (
    vendid CHAR(4) PRIMARY KEY,
    `name` VARCHAR(50),
    address VARCHAR(50),
    zip_code VARCHAR(10),
    state CHAR(2),
    license VARCHAR(50),
    phone VARCHAR(25),
    email VARCHAR(50),
    subscriptionEndsOn DATE
);
CREATE TABLE provider (
    providerid CHAR(4) PRIMARY KEY,
    `name` VARCHAR(50),
    address VARCHAR(50),
    zip_code VARCHAR(10),
    state CHAR(2),
    phone VARCHAR(25),
    email VARCHAR(50)
);
CREATE TABLE paymentCard (
    cardid CHAR(5) PRIMARY KEY,
    nameOnCard VARCHAR(25),
    card_type VARCHAR(25),
    card_number VARCHAR(25),
    expiration_date DATE,
    card_security_number VARCHAR(10),
    zip_code VARCHAR(10),
	repid CHAR(4),
    CONSTRAINT fk_paymentcard_repairshop_id FOREIGN KEY(repid) REFERENCES repairShop(repid)
);
